import Vue from 'vue';
import MyNav from '@/components/Nav.vue';
import MyContent from '@/components/Content.vue';
import { fetchFile } from '@/helper/fetch-file.ts';
import { renderMan, Result } from '@/helper/render-man.ts';
export default Vue.extend({
  components: { MyNav, MyContent },
  data() {
    return {
      result: null as Result | null,
    };
  },
  computed: {
    name(): string {
      return this.$route.params.name;
    },
  },
  watch: {
    $route: {
      immediate: true,
      handler() {
        this.render();
      },
    },
  },
  methods: {
    async render() {
      this.result = await this.$store.dispatch('renderApp', this.name);
    },
  },
});
